import MultiplePizzas from '../assets/multiplePizzas.jpeg'
import '../styles/About.css'

function AboutUs() {
  return (
    <div className="about">
      <div className="aboutTop" style={{ backgroundImage: `url(${MultiplePizzas})` }}></div>
      <div className="aboutBottom"></div>
    </div>
  )
}

export default AboutUs
